// src/App.js

import React, { useState } from 'react';
import Login from './components/Login';

function App() {
  const [user, setUser] = useState(null);

  const handleLogin = (userData) => {
    setUser(userData);  // Register that user is "logged in"
  };

  return (
    <div>
      {!user ? (
        <Login onLogin={handleLogin} />
      ) : (
        <h1>Welcome, {user.email}!</h1> // Placeholder for later authenticated view
      )}
    </div>
  );
}

export default App;
